#alert {
  display: none;
  position: absolute;
  top: 200px;
  left: 50%;
  transform: translateX(-50%);
  width: 300px;
  height: 120px;
  font-family: "Pretendard-Regular";
  background-color: #FCFAEE;
  border: 5px double #000;
  border-radius: 3px;
}

#alert p {
  display: none;
  position: absolute;
  top: 40px;
  left: 60px;
}

#alert span {
  position: absolute;
  top: 85px;
  right: 20px;
  font-size: 14px;
  color: #fff;
  background-color: #333;
  padding: 3px 10px;
  border: 1px solid #333;
  border-radius: 3px;
  cursor: pointer;
  transition: all 0.3s;
}

#alert span:hover {
  color: #333;
  border: 1px solid #333;
  background-color: #FCFAEE;
  box-sizing: border-box;
}

